import React, { useState, useEffect } from 'react';
import { Select, MenuItem } from '@material-ui/core';
import { Client, VeterinariansApiFactory } from '../json/api.ts';


interface Post {
    id: string;
    name: string;
}

interface IVeterinariansInfo {
    post: {
        id : string;
        name: string;
        dateOfBirth: string;
        phoneNumber: string;
        education: string;
    };
}

interface IClientInfo {
    client: {
        id : string;
        name: string;
        phoneNumber: string;
        veterinariansId: number;
    };
}

interface ISelectVeter {
    client : any,
}
const SelectVeter: React.FC<ISelectVeter> = (postId) => {
    const [id, setId] = useState(0);
    const [veterinariansId, setVeterinariansId] = useState<number | undefined>();
    const [name, setName] = useState('');
    const [phoneNumber, setPhoneNumber] = useState();
    const [dateOfBirth, setDateOfBirth] = useState('');
    const [education, setEducation] = useState('');
    const [data, setData]: any = useState<Post[]>([]);
    const [selectedName, setSelectedName] = useState<string | undefined>();
   

    const functionFromApi = VeterinariansApiFactory();

    const client: Client = {
        id: id,
        name: name,
        phoneNumber: phoneNumber,
        veterinariansId: veterinariansId
    };

    const handlePutVetData = async (id) => {
        console.log(selectedName);
        try {
            const response = await functionFromApi.apiVeterinariansIdPut(id, client,  {});
            console.log(response);
        } catch (error) {
            console.log(error);
        }
    }
    async function getVetDataFromApi() {
        const response = await functionFromApi.apiVeterinariansGet();
        const { data } = response;
        setData(data);
        if(selectedName){
            handlePutVetData(selectedName)
        }
    }

    useEffect(() => {
        getVetDataFromApi();
    }, []);

    return (
        <Select value={selectedName} onChange={(event) => 
        {setVeterinariansId(event.target.value as number) 
        console.log(postId)}
        } >
            {data.map((post) => (
                <MenuItem key={post.id} value={post.id}>{post.name}</MenuItem>
            ))}
        </Select>
    );
}

export default SelectVeter;
